import React from 'react';

const Spacing = () => {
  const marginClasses = [
    { id: 500, classTitle: 'mAuto' },
    { id: 50, classTitle: 'm0' },
    { id: 51, classTitle: 'm1' },
    { id: 52, classTitle: 'm2' },
    { id: 53, classTitle: 'm3' },
    { id: 54, classTitle: 'm4' },
    { id: 55, classTitle: 'm5' },
    { id: 56, classTitle: 'm6' },
  ];
  const paddingClasses = [
    { id: 40, classTitle: 'p0' },
    { id: 41, classTitle: 'p1' },
    { id: 42, classTitle: 'p2' },
    { id: 43, classTitle: 'p3' },
    { id: 44, classTitle: 'p4' },
    { id: 45, classTitle: 'p5' },
    { id: 46, classTitle: 'p6' },
  ];

  return (
    <>
      <div className='containerFluid1 container1-lg'>
        <div className='sectionTitle fontStyled primary'>
          <h5 className='fsH5 pb2'>Spacing</h5>
          <h6 className='fsSM pb1'>Classes Names</h6>
        </div>

        <div className='sectionTitle fontStyled primary'>
          <h6 className='fsSM pb1'>Margins</h6>
        </div>

        {marginClasses.map((mc) => (
          <div key={mc.id} className='row alignCenter'>
            <div className='col5 h100'>
              <div className={`bgLight`}>.{mc.classTitle}</div>
            </div>
            <div className='col7 bgPrimary border'>
              <div className={`bgLight textCenter ${mc.classTitle}`}>
                {mc.classTitle}
              </div>
            </div>
          </div>
        ))}
      </div>
    </>
  );
};

export default Spacing;

